pragma solidity ^0.6.0;

import './GX_Lock.sol';

/// @author Solidity Services
/// @title Galaxis: Rules of the fund
/// @notice Set of simple rules for a fund
contract GX_SimpleCloseEndRules is GX_Lock {

    /// STATE VARIABLES

    /// @notice block when the investment can start
    uint public investStart;
    /// @notice block when the investment will end
    uint public investEnd;
    /// @notice minimum investment
    uint public investMin;
    /// @notice maximum investment
    uint public investMax;
    /// @notice block when the withdraw can start
    uint public withdrawStart;
    /// @notice block when the withdraw will end
    uint public withdrawEnd;
    /// @notice marge of the trader
    uint public traderMarge;

    /// EVENTS

    /// EVENTS: user facing events

    /// @notice event for closing the fund
    event GX_FundClosed(
        uint indexed withdrawStart,
        uint withdrawEnd
    );

    /// @notice event for changing the fund rules
    event GX_FundRulesChanged(
        uint indexed investStart,
        uint indexed investEnd,
        uint investMin,
        uint investMax,
        uint indexed withdrawStart,
        uint withdrawEnd,
        uint traderMarge
    );

    /// CONSTRUCTORS

    /// MODIFIERS

    /// TRANSACTIONS

    /// @notice changing the rules
    /// @dev ...
    /// @param _investStart new investment start
    /// @param _investEnd new investment end
    /// @param _investMin new investment minimum
    /// @param _investMax new investment maximum
    /// @param _withdrawStart new withdraw start
    /// @param _withdrawEnd new withdraw end
    function changeRules(
        uint _investStart,
        uint _investEnd,
        uint _investMin,
        uint _investMax,
        uint _withdrawStart,
        uint _withdrawEnd,
        uint _traderMarge
    ) public onlyAdmin {
        investStart = _investStart;
        investEnd = _investEnd;
        investMin = _investMin;
        investMax = _investMax;
        withdrawStart = _withdrawStart;
        withdrawEnd = _withdrawEnd;
        traderMarge = _traderMarge;

        emit GX_FundRulesChanged(
        _investStart,
        _investEnd,
        _investMin,
        _investMax,
        _withdrawStart,
        _withdrawEnd,
        _traderMarge
        );
    }

    /// @notice changing the rules
    /// @dev ...
    /// @param _rules rules to set
    function changeRulesArray(
        uint[] memory _rules
    ) public onlyAdmin {
        investStart = _rules[0];
        investEnd = _rules[1];
        investMin = _rules[2];
        investMax = _rules[3];
        withdrawStart = _rules[4];
        withdrawEnd = _rules[5];
        traderMarge = _rules[6];

        emit GX_FundRulesChanged(
        _rules[0],
        _rules[1],
        _rules[2],
        _rules[3],
        _rules[4],
        _rules[5],
        _rules[6]
        );
    }


    /// @notice closing the fund: withdraw can start
    /// @dev ...
    /// @param _withdrawEnd new withdraw end
    function closeFund(uint _withdrawEnd) public onlyAdmin {
        withdrawStart = block.number;
        withdrawEnd = _withdrawEnd;

        emit GX_FundClosed(
            withdrawStart,
            withdrawEnd
        );
    }

    /// VIEWS

    /// @notice is it allowed to invest
    /// @dev ...
    function isAllowedDeposit(address _tknDeposit, uint _amount) public override view returns (bool) {
        // access rules ?

        // lifecycle rules
        require(investStart <= block.number, "Investment is too early");
        require(investEnd >= block.number, "Investment is too late");

        // additional rules: amount of investment
        require(investMin <= _amount, "Investment is too small");
        require(investMax >= _amount, "Investment is too big");

        // super call: check if token is whitelisted
        super.isAllowedDeposit(_tknDeposit, _amount);

        return true;
    }

    /// @notice is it allowed to withdraw
    /// @dev ...
    function isAllowedWithdraw(address _tknDeposit, uint _amount) public override view returns (bool) {

        // lifecycle rules
        require(withdrawStart <= block.number, "Withdraw is too early");
        require(withdrawEnd >= block.number, "Withdraw is too late");

        // additional rules: amount of withdraw
        require(investMin <= _amount, "Withdraw is too small");
        require(investMax >= _amount, "Withdraw is too big");

        super.isAllowedWithdraw(_tknDeposit, _amount);

        return true;
    }

    /// @notice is it allowed to trade
    /// @dev ...
    function isAllowedPlaceOrder() public override view returns (bool) {
        super.isAllowedPlaceOrder();
        return false;
    }

    /// UTILS


}

